CREATE SCHEMA goodwin

CREATE TABLE "goodwin"."aircraft_flights" (
    "id" text NOT NULL DEFAULT concat('flt', substr(md5((random())::text), 0, 12)),
    "flight_id" varchar(128) NOT NULL,
    "tail_number" varchar(128) NOT NULL,
    "actual_gate_arrival_time" varchar(128),
    "actual_gate_departure_time" varchar(128),
    "actual_runway_arrival_time" varchar(128),
    "arrival_delay" varchar(128),
    "atc_ident" varchar(128),
    "baggage_claim" varchar(128),
    "blocked" bool,
    "cancelled" bool,
    "departure_delay" varchar(128),
    "diverted" bool,
    "estimated_gate_arrival_time" varchar(128),
    "estimated_gate_departure_time" varchar(128),
    "estimated_runway_arrival_time" varchar(128),
    "estimated_runway_departure_time" varchar(128),
    "filed_airspeed" varchar(128),
    "filed_altitude" varchar(128),
    "filed_ete" varchar(128),
    "flight_number" varchar(128),
    "gate_destination" varchar(128),
    "gate_origin" varchar(128),
    "operator_iata" varchar(128),
    "origin" varchar(4),
    "destination" varchar(4),
    "progress_percent" varchar(128),
    "registration" varchar(128),
    "route" text,
    "route_distance" varchar(128),
    "scheduled_gate_arrival_time" varchar(128),
    "scheduled_gate_departure_time" varchar(128),
    "scheduled_runway_arrival_time" varchar(128),
    "scheduled_runway_departure_time" varchar(128),
    "seats_cabin_business" varchar(128),
    "seats_cabin_coach" varchar(128),
    "seats_cabin_first" varchar(128),
    "status" varchar(128),
    "terminal_destination" varchar(128),
    "terminal_original" varchar(128),
    "created_at" timestamp(3) NOT NULL DEFAULT CURRENT_TIMESTAMP,
    "created_by" varchar(128),
    "updated_at" timestamp(3),
    "updated_by" varchar(128),
    "actual_runway_departure_time" varchar(128),
    "destination_timezone" varchar(128),
    "origin_timezone" varchar(128),
    "inbound_fa_flight_id" varchar(128),
    PRIMARY KEY ("id")
);


